{"41": ["Показывает неправильно. Завышенный градус температуры при +26 показывает +31", "2020-12-18T08:23:49Z", "", "0", 1, 0, 1, "Термометр  для аквариума тонкий AIM Rod Thermometer Blister (KW)", "KW Zone"], "42": ["Показывает температуру верно (сверяла с другим градусником), шкалу видно хорошо. Присоска держит отлично, тоненький и аккуратненький. За 106 рублей - замечательный термометр.", "2020-12-17T21:34:42Z", "", "0", 1, 0, 5, "Термометр  для аквариума тонкий AIM Rod Thermometer Blister (KW)", "KW Zone"], "47": ["Пришёл целый. Всё работает. Рыбками нравится.", "2020-12-05T11:10:43Z", "", "0", 1, 0, 5, "Термометр  для аквариума тонкий AIM Rod Thermometer Blister (KW)", "KW Zone"], "60": ["Когда заказывала термометр, в описании к товару было указано - произведено: Германия. По факту оказался Китай. Да и Бог бы с ним, давно ни для кого не секрет, что большинство товаров везут из Поднебесной... Но зачем обманывать? Магазин настолько не уважает своих покупателей? Одна звезда за то, что привезли термометр целым. Теперь осталось только определить правильность показаний прибора. Как это сделать, пока ума не приложу - ибо два разных термометра, купленных на WB, показывают разную температуру...", "2020-11-14T07:53:30Z", "", "0", 1, 1, 1, "Термометр  для аквариума тонкий AIM Rod Thermometer Blister (KW)", "KW Zone"], "69": ["Приятный на вид термометр,  15 см в длину.", "2020-10-06T19:45:18Z", "", "0", 1, 0, 5, "Термометр  для аквариума тонкий AIM Rod Thermometer Blister (KW)", "KW Zone"]}
